<!DOCTYPE html>

<script src="https://code.jquery.com/jquery-2.2.4.min.js"></script>
<style>
#layer7 g:hover path, circle:hover {
  
    stroke: #002868 !important;
    stroke-width:2px;
    stroke-linejoin: round;
    fill: #002868 !important;
    cursor: pointer;
}
#info-box {
  display: none;
  width: 400px;
  position: absolute;
  top: 0px;
  left: 0px;
  z-index: 1;
  background-color: #ffffff;
  border: 2px solid #BF0A30;
  border-radius: 5px;
  padding: 5px;
  font-family: arial;
}
</style>

<script>
$(function() {
	$("g:has(> desc)").hover(function(e) {
	  $('#info-box').css('display','block');
	  //$('#info-box').html($(this).data('info'));
	  console.log($(this));
	  $('#info-box').html($('desc', this).text());
	});
	$("g:has(> desc)").mouseleave(function(e) {
	  $('#info-box').css('display','none');
	});
});
$(document).mousemove(function(e) {
	var y = Math.max(e.pageY-$('#info-box').height()-30, 0);
	//console.log('Y is:' + y == 0 ? e.pageY+$('#info-box').height()-30 : y);
	$('#info-box').css('top', y == 0 ? e.pageY + 30 : y);
	$('#info-box').css('left',e.pageX-($('#info-box').width())/2);
}).mouseover();
</script>
<div id="info-box">

</div>

      <desc
         id="desc1568">&lt;big&gt;&lt;b&gt;Country:&lt;/b&gt; Suyu Volkskolonie (&lt;i&gt;Drachen Suyu&lt;/i&gt;)&lt;/big&gt;
&lt;big&gt;&lt;b&gt;Capital:&lt;/b&gt; Uma&lt;/big&gt;
&lt;br&gt;
&lt;br&gt;
&lt;b&gt;
	The southernmost Drachen colony, Suyu is far more developed than its northern brother, having been home to a stationary Inca-like people. Suyu continues to be the more productive of the pair of colonies, having been subject to much development and economic growth. Unlike Illu, Suyu's administration is primarily operated by its own natives, being more apt to call it autonomous in the Volksunion family.
&lt;/b&gt;</desc>

      <desc
         id="desc2410">&lt;big&gt;&lt;b&gt;Country:&lt;/b&gt; Illu Volkskolonie (&lt;i&gt;Drachen Illu&lt;/i&gt;)&lt;/big&gt;
&lt;big&gt;&lt;b&gt;Capital:&lt;/b&gt; Siulliq&lt;/big&gt;
&lt;br&gt;
&lt;br&gt;
&lt;b&gt;
The northernmost Drachen colony, Illu is the less developed of the two colonies, being home to primarily nomadic groups of Inuit-like peoples. While Illu is technically autonomous, the nature of its residences leave much of the administrative work to Drachenstaat born officers and military personnel.
&lt;/b&gt;	</desc>
